Chanpuru(jap.チャンプルー) ist ein Japanisches Gericht aus Okinawa mit Gemüses, Tofu und Fleisch oder Fische. Vor allem auf Okinawa ist dieses Gericht sehr verbreitet. Chanpuru bedeutet „mischen“ oder „ vermischen" im Okinawa-Dialekt.
