{{性的}} {{AV女優 |名前=紗倉 まな |ふりがな=さくら まな |本名= |別名= |愛称= |生年=1993 |生月=3 |生日=23 |出身地={{JPN}} |血液型=B |時点= |身長=156 |体重= |バスト=89 |ウエスト=58 |ヒップ=89 |カップ=F |身体備考= |ジャンル= |AV出演期間=2012年 - |専属契約=[[ソフトオンデマンド]] |活動備考= |他の活動= |その他= }} '''紗倉 まな'''（さくら まな [[1993年]][[3月23日]]- ）は日本の[[AV女優]]。[[工場萌え]]美少女として売り出されている。
== 略歴 == 18歳の誕生日の翌日に事務所に応募した<ref>[[週刊大衆]] 2012年6月25日号 220頁 「2012年上半期もぎたて新人AVアイドル厳選10人」</ref>。2011年11月、『工場萌え美少女 紗倉まな 18歳』でイメージビデオデビュー、[[グラビア]]でも活動していたが、2012年2月、『紗倉まな AVDebut』でAVデビューした<ref>『ショートヘアの究極美女』19-22頁 ミリオン出版 2012年6月20日 </ref>。同年4月16日にまとめられた[[DMM.com]]ランキングでは作品別と女優別ランキングで1位となった<ref>{{cite journal|date=2012-05-22 |publisher=DMM.com |journal=月刊DMM |date=2012年7月号 |pages=104-106 }}</ref>。同年6月18日には、[[石井哲]]、[[大山顕]]のタッグによるトークイベント「製鉄所萌えナイト」に[[瀬戸ちひろ]]とゲストに招かれた<ref>{{cite web|url=http://blog.excite.co.jp/exanime/18102706/ |title=「製鉄所萌えナイト」開催決定!! |publisher=エキサイトアニメニュース |date= |accessdate=2012-06-22 }}</ref>。2012年7月22日放送の『[[さんま・中居の今夜も眠れない]]』にて「[[さんま・中居の今夜も眠れない#ラブメイト10|ラブメイト10]]」の第7位に選ばれた。
